Header constants and types.
  * [jetstream](https://docs.rs/nats/latest/nats/jetstream/index.html "mod nats::jetstream")
`JetStream` stream management and consumers. Support for the `JetStream` at-least-once messaging system.
  * [kv](https://docs.rs/nats/latest/nats/kv/index.html "mod nats::kv")`unstable`
Support for Key Value Store. This feature is experimental and the API may change.
  * [object_store](https://docs.rs/nats/latest/nats/object_store/index.html "mod nats::object_store")`unstable`
Support for Object Store. This feature is experimental and the API may change.


## Structs[§](https://docs.rs/nats/latest/nats/#structs)
  * [Connection](https://docs.rs/nats/latest/nats/struct.Connection.html "struct nats::Connection")
A NATS connection.
  * [Handler](https://docs.rs/nats/latest/nats/struct.Handler.html "struct nats::Handler")
A `Handler` may be used to unsubscribe a handler thread.
  * [Message](https://docs.rs/nats/latest/nats/struct.Message.html "struct nats::Message")
A message received on a subject.
  * [Options](https://docs.rs/nats/latest/nats/struct.Options.html "struct nats::Options")
Connect options.
  * [ServerAddress](https://docs.rs/nats/latest/nats/struct.ServerAddress.html "struct nats::ServerAddress")
Address of a NATS server.
  * [ServerInfo](https://docs.rs/nats/latest/nats/struct.ServerInfo.html "struct nats::ServerInfo")
Information sent by the server back to this client during initial connection, and possibly again later.
  * [Subscription](https://docs.rs/nats/latest/nats/struct.Subscription.html "struct nats::Subscription")
A `Subscription` receives `Message`s published to specific NATS `Subject`s.


## Traits[§](https://docs.rs/nats/latest/nats/#traits)
  * [IntoServerList](https://docs.rs/nats/latest/nats/trait.IntoServerList.html "trait nats::IntoServerList")
Capability to convert into a list of NATS server addresses.


